import Header from "./elements/header";
import Footer from "./elements/footer";
import React, { Component } from "react";
import { AuthService } from "../services/AuthService";

class Layout extends Component {
  render() {
    return (
      <div>
        <Header />
        {this.props.children}
        <Footer />
      </div>
    );
  }
}

export default Layout;
